import React, { useState } from 'react';
import SearchBox from './searchBox';

function CarCollection() {
  const [year, setYear] = useState('');
  const [make, setMake] = useState('');
  const [minPrice, setMinPrice] = useState('');
  const [maxPrice, setMaxPrice] = useState('');
  const [filteredCars, setFilteredCars] = useState([]);

  const handleSearch = () => {
    // Perform search logic here
    const newFilteredCars = cars.filter((car) => {
      if (year && car.year.toString() !== year) {
        return false;
      }
      if (make && car.make !== make) {
        return false;
      }
      if (minPrice && car.price < parseInt(minPrice)) {
        return false;
      }
      if (maxPrice && car.price > parseInt(maxPrice)) {
        return false;
      }
      return true;
    });
    setFilteredCars(newFilteredCars);
  };

  const handleClear = () => {
    setYear('');
    setMake('');
    setMinPrice('');
    setMaxPrice('');
    setFilteredCars([]);
  };

  const cars = [
    { id: 1, make: 'Toyota', year: 2022, price: 10000 },
    { id: 2, make: 'Honda', year: 2021, price: 15000 },
    { id: 3, make: 'Ford', year: 2020, price: 20000 },
    // Add more car objects as needed
  ];

  return (
    <div>
      <SearchBox
        year={year}
        make={make}
        minPrice={minPrice}
        maxPrice={maxPrice}
        onSearch={handleSearch}
        onClear={handleClear}
        filteredCars={filteredCars}
      />
      <div className="car-collection">
        {filteredCars && filteredCars.length > 0 ? (
          filteredCars.map((car) => (
            <div key={car.id}>
              <h3>{car.make}</h3>
              <p>Year: {car.year}</p>
              <p>Price: {car.price}</p>
              {/* Add more car details as needed */}
            </div>
          ))
        ) : (
          <p>No cars found</p>
        )}
      </div>
    </div>
  );
}

export default CarCollection;
